import { Route, BrowserRouter as Router, Switch, Link, BrowserRouter } from "react-router-dom";

function App() {

  return (
    <BrowserRouter>
    <Switch>
      <Route path="/" exact component={App} />
    </Switch>
    </BrowserRouter>
  );
}

export default App;
